import React from "react";
import { ListGroup } from "react-bootstrap";
const CommandList = ({ items }) => {
  return (
    <ListGroup as="ul">
      {items.map((item, index) => (
        <ListGroup.Item key={index} as="li" active>
          {item}
        </ListGroup.Item>
      ))}
    </ListGroup>
  );
};

export default CommandList;
